```python
def find_common_elements(matrix1, matrix2):
    common_elements = []
    for row1 in matrix1:
        for row2 in matrix2:
            for element in row1:
                if element in row2:
                    common_elements.append(element)
    return common_elements
```

Denne algoritmen går gjennom hvert element i hver rad i begge matrisene og sjekker om elementet finnes i den andre matrisen. Hvis det gjør det, legges det til i en ny liste som returneres av funksjonen.

Noter at denne algoritmen har en O(n^3) kompleksitet, der n er størrelsen på de to matrisene. Det vil si at den tar lang tid å kjøre hvis matrisene er store. Det kan være mer effektivt å bruke datastrukturer som et sett eller en hash-tabell for å finne de felles elementene.

Her er et program i C som bruker dynamisk programmering for å finne det n-te Fibonacci-tallet:

#include <stdio.h>

// Definerer funksjonen fibonacci(n) som returnerer det n-te Fibonacci-tallet
int fibonacci(int n) {
    // Definerer en tabell med størrelse n+1, der fib[0] og fib[1] er satt til 0 og 1
    int fib[n + 1];
    fib[0] = 0;
    fib[1] = 1;

    // Loopet går fra 2 til n og beregner Fibonacci-tallene
    for (int i = 2; i <= n; i++) {
        fib[i] = fib[i - 1] + fib[i - 2];
    }

    // Returnerer det n-te Fibonacci-tallet
    return fib[n];
}

// Hovedfunksjonen
int main() {
    int n;

    printf("Skriv inn n: ");
    scanf("%d", &n);

    // Printer ut det n-te Fibonacci-tallet
    printf("Det %d. Fibonacci-tallet er %d\n", n, fibonacci(n));

    return 0;
}

