Her er et C++-program som leser en tekstfil linje for linje og teller antall forekomster av et spesifikt ord i filen:

#include <iostream>
#include <fstream>
#include <string>
using namespace std;

int main() {
    string word; // ordet som skal telles
    int count = 0; // teller

    // legger inn ordet som skal telles
    cout << "Skriv inn det ordet som skal telles: ";
    cin >> word;

    // åpner filen og leser linje for linje
    ifstream file("filnavn.txt");
    string line;
    while (getline(file, line)) {
        // teller antall forekomster av ordet
        size_t pos = line.find(word);
        while (pos != string::npos) {
            count++;
            pos = line.find(word, pos + 1);
        }
    }

    // skriver ut resultat
    cout << "Antall forekomster av " << word << " i filen: " << count << endl;

    return 0;
}

I dette programmet brukes include-filer for å importere funksjoner fra biblioteket. Vi bruker ifstream for å åpne filen, getline for å lese linje for linje, find for å finne ordet i hver linje, og teller antall forekomster.

For å bruke dette programmet, endre 'filnavn.txt' til navnet på den tekstfilen du ønsker å lese, og endre 'word' til det ordet du ønsker å telles. Kjør programmet og følg instruksjonene.

